import {
  SlRelativeTime
} from "./chunk.TOLKYYLB.js";

// src/react/relative-time/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-relative-time";
SlRelativeTime.define("sl-relative-time");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlRelativeTime,
  react: React,
  events: {},
  displayName: "SlRelativeTime"
});
var relative_time_default = reactWrapper;

export {
  relative_time_default
};
